// ==UserScript==
// @name           Play Sound Notifications for New Mail
// @namespace      blurg!
// @version        0.9.7
// @author        Yansky
// @homepage      http://userscripts.org/scripts/show/63100
// @description    Plays a sound file to notify you when you receive new email in Gmail.
// @include       http://mail.google.com/*
// @include       https://mail.google.com/*

// @tab General
// @versionorlastupdate v 0.9.7 Mar 09 2010
// ==/UserScript==

//var oggB64 = GM_getResourceURL("GMwavaudio");

var au = document.createElement('audio');
//var ausrc = 'data:audio/wav;base64,'+oggB64.split('data:application/octet-stream;base64,')[1];
var ausrc='data:audio/wav;base64,';
au.setAttribute('src', ausrc);
au.setAttribute('id', 'GMwavaudio');
document.body.appendChild(au);

var canvas_frame = document.getElementById('canvas_frame');
if(canvas_frame){
	var doc=canvas_frame.contentDocument;
	var si = window.setInterval(function(){ //gotta wait for some of the DOM to load
		var iB= doc.evaluate("//a[ contains(@title, 'Inbox') ]",doc, null, XPathResult.FIRST_ORDERED_NODE_TYPE, null ).singleNodeValue;
		if(iB){
			window.clearInterval(si);  
			var unreadNum=0;
			if(iB.innerHTML.indexOf('(')>-1){
				unreadNum=Number(iB.innerHTML.split('(')[1].split(')')[0]);
			}
			var tym = Date.now();
			doc.addEventListener('DOMNodeInserted', function(e){
				var er = e.relatedNode;
				if(er.nodeName=='A' && er.hasAttribute('title') && er.getAttribute('title').match('Inbox')){	
					var newunreadNum = 0;
					if(er.innerHTML.indexOf('(')>-1){
						newunreadNum=Number(er.innerHTML.split('(')[1].split(')')[0]);
					}				
					if(newunreadNum>unreadNum && (Date.now()-tym) > 5000 ){ //check if new unread number is larger than old unread number - and if more than one new email update occurs quickly(within 5 seconds), don't play the sound twice
						au.play();
					}
					unreadNum=newunreadNum;
					tym = Date.now();
				}
			}, false);
		}
	},500);	
}

